  <button>change!</button>
  <style>
    .color-change, .color-change-stroke {
       transition: all 2s ease-in-out 0s;
    }
  </style>
  <script>
    function changeColor (color) {
      var colorchange = document.querySelectorAll('.color-change');
      var colorchangestroke = document.querySelectorAll('.color-change-stroke');
      [].forEach.call(colorchange, function(el) { el.setAttribute('fill', color) });
      [].forEach.call(colorchangestroke, function(el) { el.setAttribute('stroke', color) });
    }


    var currentIndex = 0;
    var colors = ["#595959", '#3cd3c4', '#747b6a', '#b89c2f','#321F39', '#ef6c48']

    document.querySelector('button').addEventListener('click', function() {
      changeColor(colors[currentIndex]);
      currentIndex = (currentIndex + 1) % colors.length;
  });
  </script>
